    getDataById(id) {
        return new Promise((resolve, reject) => {
            setTimeout(() => {
                if (Math.random() > 0.85) {
                    reject(new Error("Something bad happen"));
                } else {
                    resolve(this.data.find((x) => x.id === Number(id)));
                }
            }, 100);
        });
    }
